import React from "react";
import Card from "../UI/Card";
import HomeList from "./HomeList";
import classes from './Home.module.css';

const Home = () => {
  const appListArr = ['Borrow Assistance', 'Lend Assistance', 'Crypto Trade Assistance', 'NFT Trade Assistance'];
  const dataListArr = ['Floor Price, Volume, etc.', 'Crypto Price, Market Cap, etc'];
  const plansArr = ['Currently Free', 'Monthly, Yearly, Life', 'Follow socials for updates'];
  const linksArr = [['https://twitter.com/CNiphty', 'CNiphty Twitter'], ['https://twitter.com/CNiphtyProphet', 'CNiphtyProphet Twitter'], ['https://discord.com/channels/1028109414193975336/1028109415607455816', 'Discord'], ['https://medium.com/@programmedhart/cniphtypaper-1-0-dc8a72587ac4', 'LitePaper']];



  const app = appListArr.map(x => <li>{x}</li>);
  const data = dataListArr.map(x => <li>{x}</li>);
  const plans = plansArr.map(x => <li>{x}</li>);
  const links = linksArr.map(x => <li><a className={classes.a} href={x[0]}>{x[1]}</a></li>);

  return (

    <Card className={classes.container}>
        <h2>More Details at Bottom</h2>
      <Card className={classes.list}>
        <HomeList header={"CNiphtyProphet App"} children={app} />
      </Card>
      <Card className={classes.list}>
        <HomeList children={data} header={"Data Tools"} />
      </Card>
      <Card className={classes.list}>
        <HomeList children={plans} header={"Plans"} />
      </Card>
      <Card className={classes.list}>
        <HomeList children={links} header={"Other Links"}/>
      </Card>
    </Card>
  );
};

export default Home;
